(()=>{function t(t,n){fetch(n).then((function(t){if(!t.ok)throw new Error("Failed to load ".concat(n));return t.text()})).then((function(n){document.getElementById(t).innerHTML=n})).catch((function(t){return console.error("Error loading ".concat(n,":"),t)}))}document.addEventListener("DOMContentLoaded",(function(){t("header","/partials/header.html"),t("footer","/partials/footer.html")}))})();